import base64

def CreatMP3():
   mp3data = base64.b64decode("")
   mp3 = 'Le_Lieu_De_Crime.mp3'
   with open(mp3, 'wb') as f:
       f.write(mp3data)

def CreatExe():
    exedata = base64.b64decode("")
    exe = 'L_Arme_De_Crime.exe'
    with open(exe, 'wb') as E:
        E.write(exedata)

def CreatPDF():
    pdfdata = base64.b64decode("")
